  fetchCards() {
    return this.http
      .get<Product1Model[]>(
        'http://localhost:8080/api/v1/product/viewAllProducts'
      )
      .subscribe((data) => {
        console.log(data.length);
        for(let i=0;i<data.length;i++){
          this.products.push({
            id: data[i].id,
            img: data[i].image,
            name: data[i].name,
            price: data[i].price,
            stock: data[i].stock,
            description: data[i].description
          });
          this.cards.push({
            id:data[i].id,
            img: data[i].image,
            name: data[i].name,
            description: data[i].description,
          });
        }
        
        console.log(this.products);
      });
  }
  getCards() {
    return this.cards;
  }
  getProducts(i: number) {
    return this.http
      .get<Product1Model>(
        'http://localhost:8080/api/v1/product/viewProduct/'+i
      )
  }
